import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav style={styles.navbar}>
      <h2 style={styles.logo}>PEAS</h2>
      <div style={styles.navLinks}>
        <Link to="/" style={styles.link}>Home</Link>
        <Link to="/museums" style={styles.link}>Museums</Link>
        <Link to="/about" style={styles.link}>About</Link>
        <Link to="/chat" style={styles.link}>Chat</Link>
        <Link to="/contact" style={styles.link}>Contact</Link>
      </div>
    </nav>
  );
}

const styles = {
  navbar: {
    position: "fixed",         // ✨ Added this
    top: 0,                    // ✨ Stick to the top
    width: "100%",             // ✨ Full width
    zIndex: 1000,              // ✨ Stay above other elements
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    backgroundColor: "#2E8B57",
    padding: "10px 20px",
    boxShadow: "0 2px 5px rgba(0,0,0,0.2)",   // ✨ Slight shadow for nice effect
  },
  logo: {
    color: "white",
    margin: 0,
  },
  navLinks: {
    display: "flex",
    gap: "20px",
  },
  link: {
    color: "white",
    textDecoration: "none",
    fontSize: "18px",
  },
};

export default Navbar;
